  return (
    <tr key = {input.ak} className="clickable" onClick={() => console.log(input)}>          
    <td>{input.ak}</td>
    <td>{input.fname}</td>
    <td>{input.lname}</td>
    <td>{input.email}</td> 
    <td>{input.age}</td>       
   </tr>
  );
}

